    function enableTrading() external onlyOwner {
        _tradingFeesEnabled = TRUE;
        emit TradingFeesEnabled();
    }

    /**
     * @dev Disable buy fees mechanism.
     *
     * Emits a {TradingFeesDisabled} event.
